import StateProvider from '../components/context/StateProider';
import Layout from '../components/layout';
import Footer from '../components/footer';

const MyApp = ({ Component, pageProps }) => {
  return (
    <StateProvider>
      <Layout>
        <Component {...pageProps} />
      </Layout>
      <Footer />
    </StateProvider>
  );
};

export default MyApp;
